    Card,
    CarrdImg,
    FormGroup,
    Jumbotron,
    Container,
    Label,
    Input,
    FormText,
    InputGroup,
  } from "reactstrap";
  import pic from "../assets/img/haland.jpeg";
export default class PlayerDetail extends Component {
    render() 
    {

        return (
            <div>

                      <Row className="justify-content-center ">
                      <Card >
                      <CardImg top width="100%" src={pic} alt="Card image cap" />

                            </Card>
                       </Row>


            </div>
        )
    }
}
